import React, { useState } from "react";

function Login(){
    const[email, setEmail] = React.useState("");
    const[password, setPassword] = React.useState("");

    function handleEmail(event){
        const{name, value} = event.target;
        setEmail(value);
    }
    function handlePassword(event){
        const{name, value} = event.target;
        setPassword(value);
    }

    function handleClick(){
        console.log(email);
        console.log(password);
    }

    return <div className = "login">
        <div className = "left">
            <h1 className="name">AutoX</h1>
            <div className = "inner">
                <h1>Welcome Back!</h1>
                <p>Welcome back! Please enter your details</p>
                <label>Email</label>
                <br></br>
                <input onChange={handleEmail} className="input-box" name = "email" value = "" type="text" placeholder="Enter your email"></input>
                <br></br>
                <label>Password</label>
                <br></br>
                <input onChange={handlePassword} className="input-box" name = "password" value = "" type="password" placeholder="Enter your password"></input>
                <div className="box1">
                    <div>
                        <input type = "checkbox"></input>
                        <p>Remember for 30 days</p>
                    </div>
                    <p>Forgot Password?</p>
                </div>
                <button onClick={handleClick} type = "submit"> Sign in</button>
                <br></br>
                <button type = "submit">Sign in with Google</button>
                <p className="sp">Don't have an account?<span>Sign Up</span></p>
                <p className="copyright">2023 Copyrights Reserved</p>
            </div>
            
        </div>
        <div className = "right">
            <div>
                <img src = "./img/login_background.png" />
            </div>
            <div className="title">
                <h1>
                    AutoX
                </h1>
                <p>Your Trust, Our Priority</p>
            </div>
        </div>
    </div>
}
export default Login;
